   addTagTreeToNode(nodeArray: TagNode[], tagtree: any) {
      if(tagtree == undefined){
         return
      }
      //console.log("In addTagTreeToTagSelector:", nodeArray, tagtree);
      for (let tagName of Object.keys(tagtree)) {
         let tagData = tagtree[tagName];
         //console.log("Adding:", tagName, tagData);

         if (tagData.arraydim > 1) {
            for (let i = 0; i < tagData.arraydim; i++) {
               const newNode: TagNode = { name: tagName + '[' + i.toString() + ']', dataType: tagData.datatype, showChildren: false, editable: tagData?.config?.editable ?? true, hidden: tagData?.config?.hidden ?? false};
               if (tagData.datatype == 'Folder') {
                  newNode.children = [];
                  this.addTagTreeToNode(newNode.children, tagData.children);
               }
               //console.log(newNode)
               nodeArray.push(newNode);
            }
         } else {
            const newNode: TagNode = { name: tagName, dataType: tagData.datatype, showChildren: false,  editable: tagData?.config?.editable ?? true, hidden: tagData?.config?.hidden ?? false};
            if (tagData.datatype == 'Folder') {
               newNode.children = [];
               this.addTagTreeToNode(newNode.children, tagData.children);
            }
            //console.log(newNode)
            nodeArray.push(newNode);
         }
      }
   }

   // Function that return a nested object object with all the value items displayed 
   // in the database view tree. The items are returned with null as value.
   // The receiving device will fill it with data to be displayed later on
   public getDisplayedValuesFromNode(dataobject: any, nodeArray: TagNode[]) {
      for (let i = 0; i < nodeArray.length; i++) {
         if (nodeArray[i].showChildren) {
            const newObj = {}
            this.getDisplayedValuesFromNode(newObj, nodeArray[i].children!);
            if (Object.keys(newObj).length > 0) {
               dataobject[nodeArray[i].name] = newObj;
            }
         } else {
            if (nodeArray[i].dataType != 'Folder') {
               dataobject[nodeArray[i].name] = null;
            }
         }
      }
   }

   buildTagSelector() {
      this.addTagTreeToNode(this.databaseTagValuesTree, this.hardwareConfig.database.tags);
      this.addTagTreeToNode(this.databaseTagValuesTree, this.configFile.database.tags);
   }   

   getDatabaseContainingFolder(location: string) {
      if (location=='') {
         return this.configFile.database.tags;
      }

      const tagPath = location.split('.');

      if (tagPath.length == 0) {
         let currentFolder = this.configFile.database.tags[location];
         if (currentFolder==undefined) {
            console.log("Undefined tag requested, returning root");
            return this.configFile.database.tags;
         }
      }
       
      let currentFolder = this.configFile.database.tags[tagPath[0]];
      for (let i = 1; i < tagPath.length; i++) {
         if (currentFolder.datatype=="Folder") {
            currentFolder = currentFolder.children[tagPath[i]]
         } else {
            return currentFolder;
         }
      }
      return currentFolder;
   
   }

   getDatabaseContainingFolderAndNext(location: string): any {
      const result: any = {}
      if (location=='') {
         result.container = this.configFile.database.tags;
         result.next = null;
         result.nextName = '';
         return result;
      }

      const tagPath = location.split('.');
      
      result.container = this.configFile.database.tags;
      result.next = null;
      result.nextName = '';

      for (let i = 0; i < tagPath.length; i++) {
         if ( result.next!=null && result.next.datatype == 'Folder') {
            result.container = result.next.children;
         } 
         result.next = result.container[tagPath[i]];
         result.nextName = tagPath[i];
      }
      return result;
   }

   getNewTagName(containerFolder: any, newTagNameBase = '_NewTag') {
      let newTagNameIndex = 1;
      let newTagName= newTagNameBase;
      do {
         if (containerFolder[newTagName] == undefined) {
            return newTagName;
         }
         newTagName = newTagNameBase + '_' + newTagNameIndex++;
      } while (true)
   } 

   databaseAddNewTag(location: string) {
      if(location == undefined)
         location = ''
      const containingFolderAndNext = this.getDatabaseContainingFolderAndNext(location);
      if (containingFolderAndNext.next?.datatype == "Folder") {
         const newTagName = this.getNewTagName(containingFolderAndNext.next.children);
         containingFolderAndNext.next.children[newTagName] =  { "arraydim": 1, "datatype": "Number", "value": 0,
            "config": {
               "persistent": false,
               "historic": false,
               "hidden": false,
               "editable": true
            }
         }    
      } else {
         const newTagName = this.getNewTagName(containingFolderAndNext.container);
         containingFolderAndNext.container[newTagName] =  { "arraydim": 1, "datatype": "Number", "value": 0,
            "config": {
               "persistent": false,
               "historic": false,
               "hidden": false,
               "editable": true
            }
         }   
      }
   }


   databaseAddNewFolder(location: string) {
      if(location == undefined)
         location = ''
      const containingFolderAndNext = this.getDatabaseContainingFolderAndNext(location);
      if (containingFolderAndNext.next?.datatype == "Folder") {
         const newTagName = this.getNewTagName(containingFolderAndNext.next.children,'_NewFolder');
         containingFolderAndNext.next.children[newTagName] =  { "datatype": "Folder", "arraydim": 1, "config": {}, "children": {}}
      } else {
         const newTagName = this.getNewTagName(containingFolderAndNext.container,'_NewFolder');
         containingFolderAndNext.container[newTagName] =  { "datatype": "Folder", "arraydim": 1, "config": {}, "children": {}}
      }
   }

