   databaseDeleteTag(array: Array<string>){
      array.forEach(element => {
         const containingFolderAndNext = this.getDatabaseContainingFolderAndNext(element);
         delete(containingFolderAndNext.container[containingFolderAndNext.nextName]);
      });
   }

   getHMIViewData(viewId:any) {
      console.log("***** In getHMIViewData")
      const viewArray = this.configFile?.hmi?.views;
      if (viewArray) {
         for (let index=0;index<viewArray.length;index++) {
            console.log("Looking for: ",viewId,"Found:",viewArray[index].id)
            if (viewArray[index].id == viewId) {
               return viewArray[index];
            }
         }
      }
      return undefined;
   }
